import { Component } from 'react';
import Auth from '../components/Auth/Auth';
import Dashboard from '../components/Dashboard/Dashboard';

class App extends Component{
    constructor(props){
        super(props)

        this.state = {
            user : false
        }
    }

    render(){
        return (
            <div>
                {(this.state.user) ? <Dashboard/> : <Auth/>}
                <style jsx global>
                    {`
                        *{
                            padding: 0;
                            margin: 0;
                            border-box: box-sizing;
                        }

                        *::before, *::after{
                            padding: 0;
                            margin: 0;
                            border-box: box-sizing;
                        }

                        html{
                            font-size: 62.5%;
                        }

                        body{
                            font-family: 'Quicksand', sans-serif;
                        }
                    `}
                </style>
            </div>
        );
    }
}

export default App;
